class Solution {
  List<int> getGoodIndices(List<List<int>> variables, int target) {
    List<int> goodIndices = [];
    for (int i = 0; i < variables.length; i++) {
      int a = variables[i][0];
      int b = variables[i][1];
      int c = variables[i][2];
      int m = variables[i][3];
      if (((a * b % 10).toInt().pow(c) % m) == target) {
        goodIndices.add(i);
      }
    }
    return goodIndices;
  }
}
